text13117.addInnerText('<div id=\"text13117\" aria-hidden=\"true\" ><a id=\"text13117anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.336\" style=\"margin-left:0px;text-indent:0px;line-height:1.250;margin-top:0px;margin-bottom:11px;text-align:justify;\" >\n<span class=\"text13117Font2\"  >&nbsp;&nbsp;&nbsp;&nbsp;Energi panas bumi (</span ><span class=\"text13117Font3\"  >geothermal energy</span ><span class=\"text13117Font2\"  >) merupakan energi panas yang terkandung di dalam air panas, uap air, dan batuan mineral yang bersumber di dalam bumi. Panas bumi tersebut ditimbulkan oleh peristiwa peluruhan partikel-partikel radioaktif di dalam batuan. Panas (kalor) mengalir secara konduksi menuju bebatuan di sekitar inti bumi dan &nbsp;menyebabkan bebatuan meleleh membentuk magma. &nbsp;Dari magma inilah panas bumi berasal. Magma mengalirkan panas secara konveksi dan bergerak naik memanaskan kerak bumi sehingga menyebabkan celah atau retakan dilapisan mantel bumi. </span ><span class=\"text13117Font4\" style=\"background-color:transparent\" >\n</span ></p >\n</div>\n');
text13117.build()
